import React from 'react'
import UIButton from '../UI/UIButton'

const HeaderLogin = () => {
    return (
        <div>
            <UIButton text={'Log In'} className={"button-class, button-class--header"}/>
            <a>Already have an account?</a>
        </div>
    )
}

export default HeaderLogin
